Nuovo Devoto-Oli, il vocabolario dell’italiano contemporaneo, a cura di Giacomo Devoto, Gian Carlo Oli, Luca Serianni, Maurizio Trifone. 

ATTENZIONE - NOTE IMPORTANTI PER L’UTILIZZO DELLA APP:
Questa app NON contiene il vocabolario Nuovo Devoto-Oli. Per scaricare e consultare il Nuovo Devoto-Oli su iPad e iPhone è necessario attivare una licenza valida per la versione digitale del vocabolario; sul sito dizionario.devoto-oli.it sono disponibili tutte le informazioni necessarie per completare l’attivazione.

Non è previsto l’acquisto della versione digitale del vocabolario mediante lo strumento dell’in-App Purchase. 

Il Nuovo Devoto-Oli si propone come uno strumento linguistico fondamentale che spiega le parole in maniera chiara, completa, approfondita e guida il lettore a un uso corretto della lingua. Una nuova idea di vocabolario che risponde alle esigenze del lettore di oggi.

Le nuove rubriche "pronto soccorso linguistico", Per dirlo in italiano, Questioni di stile e Parole minate approfondiscono tutti quegli aspetti dell’italiano che possono essere fonte di dubbio, soffermandosi su parole o espressioni particolarmente critiche, spiegando norme che stanno cambiando, suggerendo gli usi più appropriati in base al contesto o alla situazione. 

L'app è progettata per offrire uno strumento capace di facilitare la ricerca e la consultazione su dispositivi mobili, con un'attenzione particolare all'accessibilità del testo:
• ricerca vocale: pronuncia il lemma da ricercare e visualizza i risultati.
• ricerca delle forme flesse: è possibile ricercare un lemma a partire dalla forma declinata o coniugata;
• strumenti per la personalizzazione: selezione dei preferiti, creazione di note testuali; 
• nuovo menù accessibilità: è possibile scegliere un font ad alta leggibilità, impostare la visualizzazione a contrasto elevato, determinare la distanza dell’interlinea e la grandezza del carattere;
• condivisione delle definizioni via social e via mail

I numeri del Nuovo Devoto-Oli:
• 115.000 voci;
• 300.000 definizioni;
• 500 neologismi e nuovi significati;
• oltre 600 note d'uso (Per dirlo in italiano, Questioni di stile, Parole minate)
• 45.000 locuzioni e modi di dire;
• 25.000 tra verbi, aggettivi e sostantivi con reggenza;
• 90.000 etimologie;
• 33.000 voci con sinonimi e contrari per un totale di 180.000;
• coniugazione completa di tutti i verbi, femminili e plurali di tutti i sostantivi, aggettivi e pronomi;
• audio con la pronuncia corretta di quasi tutte le voci;

Il vocabolario può essere scaricato sul device e consultato offline: il collegamento a Internet è necessario solo per l'ascolto dei file audio e per la condivisione dei lemmi.
